import React from "react";

import './main-content.css';

const MainContent = () => {
    return (
        <div className='main-content'>
            <h1 className='main-content__title'>Остеопороз</h1>

            <p className='main-content__text'>С остеопорозом сталкиваются практически все врачи, работающие с пациентами старших возрастных групп. Особенно часто это заболевание встречается у женщин в периоде постменопаузы.</p>

        </div>
    )
};

export default MainContent;
